import React, { useEffect, useState } from "react";
import HeaderBar from "@components/header"
import { useHistory } from "react-router-dom";
import { saleHistory } from "./request"
import "./style.scss"
import { Toast } from "antd-mobile";
const Activity = () => {
  const [data, setData] = useState<any>([])

  const { goBack } = useHistory();
  useEffect(() => {

  }, [])
  const saleHistoryHandle = () => {
    Toast.loading('加载中...')
    saleHistory().then(data => {
      setData(data)
      Toast.hide()
    })
  }
  return (
    <div className="consignment-record-wrap">
      <HeaderBar goback={goBack} title={"代售记录"} />
      <ul className="consignments">
        {
          data && data.map((item: any) => {
            return (
              <li className="item">
                <div className="item-info">
                  <div className="item-top">
                    <span className="order-icon"></span>
                    <p className="order-i">
                      <span className="special">¥100000.00</span>
                      <span>赚:<i className="info-icon"></i>¥10.00</span>
                    </p>
                  </div>
                  <span className="success">交易成功</span>
                </div>
                <p className="item-bank">
                  <span>银行卡号:111111111111111111</span>
                  <span>姓名:xxzxzz</span>
                </p>
                <p className="item-order">
                  <span>订单编号:111111111111111111</span>
                  <span>04-18 10:11:11</span>
                </p>
              </li>
            )
          })
        }
      </ul>
    </div >
  )
}
export default Activity;
